import React from 'react';
import './App.css';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import Home from './pages/Home';
import About from './pages/About'; // Update the import statement to the correct path

function App() {
  return (
    <Router>
      <div className="App">
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
          </ul>
        </nav>
        <hr />

        <Switch>
          <Route exact path="/" component={Home} />
          <Route path="/about" component={About} />

        </Switch>
      </div>
    </Router>
  );
}

export default App;
